import styled from "styled-components";
import CellPhone from "../../assets/CellPhone.svg";

const CategoriesListContent = [
  {
    id: 1,
    image: { CellPhone },
    name: "Apple",
    link: "../../assets/CellPhone.svg",
  },
];

export default function Categories() {
  return (
    <CategoriesContainer>
      <Divider>
        <div></div>
        <p>Categories</p>
      </Divider>
      <SectionTitle>Browse By Category</SectionTitle>
      <Category>
        {CategoriesListContent.map((category) => (
          <CategoriesList key={category.id}>
            <Image src={category.image} alt="Image" />
            <CategoriesName>{category.name}</CategoriesName>
          </CategoriesList>
        ))}
        <CategoriesList>
          <Image src={CellPhone} alt="Image" />
          <CategoriesName>Apple</CategoriesName>
        </CategoriesList>
      </Category>
    </CategoriesContainer>
  );
}

const CategoriesContainer = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: flex-start;
  margin-top: 60px;
  margin-bottom: 60px;
`;

const Divider = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  color: #db4444;
  div {
    width: 20px;
    height: 32px;
    background-color: #db4444;
    border-radius: 5px;
  }
  p {
    margin-left: 12px;
    font-size: 16px;
  }
`;
const SectionTitle = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: center;
  margin: 20px 0px;
  font-size: 36px;
  font-weight: 600;
`;

const Category = styled.ul`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: flex-start;
  margin: 40px 0px;
  padding: 0;
`;
const CategoriesList = styled.li`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  border: 1px solid #808080;
  width: 80px;
  height: 120px;
  padding: 25px 56px 24px 55px;
  border-radius: 4px;
  margin-right: 28px;
`;

const Image = styled.img`
  width: 50px;
  height: 50px;
`;
const CategoriesName = styled.div`
  font-size: 16px;
`;
